//import './index.css';
import Header from "./components/header";
import MacroInputs from "./components/macroInputs";
import AppBody from "./components/appBody";

function App() {
  return (
    <div className="App">
      <header>
        <Header />
      </header>

      <div className="app-body">

          <AppBody />

        <div>
          <MacroInputs />
        </div>
      </div>
    </div>
  );
}

export default App;
